import React from "react";
import "../SignUp.css";
import background from '../images/slider12.jpg'

function Signup() {
    return (
        <div
        class="bg_image"
        style={{
          backgroundImage: 'url('+background+')',
          backgroundSize: "cover",
          height: "100vh",
          color: "#f5f5f5",
          opacity: 0.7
        }}
      >
        <h1>This is Text on top</h1>
      </div>
    );
}

export default Signup;
